import React, { Component } from 'react';
import Footer from '../component/footer';
import Header from '../component/header';
import "./login.css";
import axios from 'axios';
import Qs from 'qs';

class Ligin extends Component{
    constructor(){
        super(); 
        this.handleChangeone = this.handleChangeone.bind(this);
        this.handleChangetwo = this.handleChangetwo.bind(this);

        this.state = {
            username: "",
            password:""
        }
    }
    handleChangeone(e){
        let _this = this;
        _this.setState ({
            username: e.target.value
        });
    }
    handleChangetwo(e){
        let _this = this;
        _this.setState ({
            password: e.target.value
        });
    }
    render() {
      return  <div>
      <Header></Header>
      <div class="universe">
        <div class="solarsystem">
            <div class="sun"></div>
            <a class="orbit mercury" target="_blank" href="">
                <div class="planet">
                    <div class="ball"></div>
                </div>
            </a>
            <a class="orbit venus" target="_blank" href="">
                <div class="planet">
                    <div class="ball"></div>
                </div>
            </a>
            <a class="orbit earth" target="_blank" href="">
                <div class="planet">
                    <div class="ball"></div>
                </div>
            </a>
            <a class="orbit mars" target="_blank" href="">
                <div class="planet">
                    <div class="ball"></div>
                </div>
            </a>
            <a class="orbit jupiter" target="_blank" href="">
                <div class="planet">
                    <div class="ball"></div>
                </div>
            </a>
            <a class="orbit saturn" target="_blank" href="">
                <div class="planet">
                    <div class="ball"></div>
                </div>
            </a>
            <a class="orbit uranus" target="_blank" href="">
                <div class="planet">
                    <div class="ball"></div>
                </div>
            </a>
            <a class="orbit neptune" target="_blank" href="">
                <div class="planet">
                    <div class="ball"></div>
                </div>
            </a>
            <a class="orbit pluto" target="_blank" href="">
                <div class="planet">
                    <div class="ball"></div>
                </div>
            </a>
        </div>
        <div className="login_div">
            <label>用户名：</label><input type="text" onChange={this.handleChangeone} value={this.state.username} className="username"></input>
            <label>密      码：</label><input type="text" onChange={this.handleChangetwo} value={this.state.password} className="password"></input>
            <button type="button" className="submit">提交</button>
        </div>
    </div>
      <Footer></Footer>
      </div>
    }
}

export default Ligin;
